import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
           <h1>Wlcome Deeps...</h1>
          <h2>Welcome to reactt</h2>
          <h3>Your first website is up and running</h3>
          <h4>Reactive website in Reactjs</h4>
          Edit <code>src/App.js</code> and save to reload.

        </p>

      </header>
    </div>
  );
}

export default App;
